description.narrative:
UNOPS is to contract, supervise and deliver the works of infrastructure and carry out the provision of equipment procurement included in the COVID-19 Response Program of Nicaragua to contain and control the spread of the virus  and mitigate its effect on the provision of health services in Nicaragua. UNOPS is responsible for:
managing and supervising the design, construction, improvement, expansion and equipment of ICU, hospital and emergency services in 12 existing hospitals;
managing and supervising the design, improvement, expansion and equipping of four regional epidemiological laboratories; 
supervising the installation of the equipment until it is put into operation of ICU, emergency and laboratory services; and 
carrying out the financial management of suppliers and contractors.
